import React, { Component } from 'react';
import User from '../../models/User';


interface usersState {
    allUsers : User[];
    filteredUsers : User[];
}

export default class Home extends Component <any, usersState>  {

    constructor(props : any) {
        super(props);

        this.state = {
            allUsers: [
                new User("Ben", 23, "male", true)
            ],
            filteredUsers : new Array <User> ()
        };
    }

    componentDidMount = () => {
        console.log(this.state);
    }


    render() {
        return (
            <div>
                {this.state.allUsers.map( (user, index) => 
                    <div key={index}>
                        <p>{user.name}</p>
                        <p>{user.age}</p>
                        <p>{user.gender}</p>
                        <p>{user.active}</p>
                    </div>
                )}
            </div>
        )
    }
}
